import React, { useState } from 'react';

function SearchBar(props) {
    const {handleChange, searchText } = props;
    return (
        <div>
            <i class="fa fa-search"/>
            <input
                id="search-bar"
                type="search"
                
                placeholder='Find Your SuperHero...'
                onChange={handleChange}
                value={searchText}
            />
        </div>
    );
}


export default SearchBar;
